/**
 * Created by agros on 08.06.2019.
 */
import gqt from 'graphql-tag';

export default gqt`
query ($id: String!) {
  contact(id: $id) {
    history{
      calls{
        id
        contact {
          name
          phone
          email
        }
        time
      }
    }
  }
}
`;
